import React from "react";

function CreatePost()
{
    return (
        <div className="CreatePostPage">
            <div className="cpContainer">
                <h1>Create A Post</h1>
                <div className="inputGp">
                    <label> Title:</label>
                    <input placeholder="Title..." />
                </div>
                <div className="inputGp">
                    <label> Post: </label>
                    <textarea placeholder="Post..." />
                </div>
                <button> Submit Post</button>
            </div>
         </div>
    );
}

export default CreatePost;
